import React from "react";

function CampsiteModal() {
  return (
    <div className="modal-background">
      <div className="campsite-modal">
        <div className="campsite-content">
          <div className="campsite-description">
            <h3>Lamington National Park</h3>
            <h4>Events</h4>
          </div>
          <div className="img-gallery">
            <div className="cube-img-1"></div>
            <div className="cube-img-2"></div>
            <div className="landscape-img"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CampsiteModal;
